import React from "react";
import home1 from "../img/getPaidStock.png";
import { About, DescriptionAbout, Image, Hide, Ellipse } from "../styles";
//Framer Motion
import { motion } from "framer-motion";
import { titleAnim, fade, photoAnim } from "../animation";
import Wave from "./Wave";

const AboutSection = () => {
  return (
    <About>
      <DescriptionAbout>
        <motion.div>
          <Hide>
            <motion.h2 variants={titleAnim}>Lets talk Product Design, Brand Design and Digital Marketing, sounds great?</motion.h2>
          </Hide>

        </motion.div>

        <motion.button variants={fade}>Contact Us</motion.button>
      </DescriptionAbout>
      <Image>
        <motion.img variants={photoAnim} src={home1} alt="guy with a camera" />
      </Image>
      <Wave />
      <Ellipse></Ellipse>
    </About>
  );
};

//Styled Components

export default AboutSection;
